import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);

export const store = new Vuex.Store({
    state: {
        nombre: "",
        password: "",
        nav: false,
        respuestas: [
            { contenido: "La pandemia", id: 0 },
            { contenido: "Te cogio el coronavirus", id: 1 }
        ],
        mensajes: [
            { Asunto: "Asunto", Contenido: "Mi primer mensaje", id: 0 },
            { Asunto: "Asunto 2", Contenido: "Mi segundo mensaje", id: 1 }
        ],
        mensaje_ver: "",
        asunto_ver: "",
        id: ""
    },
    mutations: {
        usuario: (state, nombre) => {
            state.nombre = nombre.name;
            state.password = nombre.pass;
            state.nav = nombre.nav;
        },
        logOut: (state, data) => {
            state.nav = data.nav;
        },
        messj: (state, data) => {
            state.mensajes.push({ Asunto: data.titulo, Contenido: data.msj, id: data.id });

        },
        mensaje_ver: (state, b) => {
            state.mensaje_ver = b.content;
            state.asunto_ver = b.subject;
            state.id = b.id;
        },
        respuesta: (state, data) => {
            state.respuestas.unshift({ contenido: data.contenido, id: data.id });

        }
    },
    actions: {
        usuario: ({ commit }, nombre) => {
            commit('usuario', nombre);
        },
        logOut: ({ commit }, data) => {
            commit('logOut', data);
        },
        messj: ({ commit }, data) => {
            commit('messj', data);
        },
        mensaje_ver: ({ commit }, b) => {
            commit('mensaje_ver', b);
        },
        respuesta: ({ commit }, data) => {
            commit('respuesta', data);
        }
    }
});
